#include <stdio.h>

int main(){
    char dna[] = "";
    char find[21] = "\0";
    scanf("%[^\n]s", find);
    int counter1 = 0;
    int counter2 = 0;
    int counter3 = 0;
    int exist = 0;
    int index = 0;
    while (dna[counter1] && !exist){
        counter2 = counter1;
        if (dna[counter1] == find[0])
            while (dna[counter2] && find[counter3]){
                if (find[counter3] != dna[counter2])
                    break;
                else if (find[counter3 + 1] == '\0'){
                    exist = 1;
                    index = counter1;
                }
                counter2++;
                counter3++;
            }
        counter1++;
        counter3 = 0;
    }
    if (exist)
        printf("Exist [%d]", index);
    else
        printf("Not Exist");
}